import styled from "styled-components";

export const Section = styled.section`
  margin-bottom: 40px;
  border: 1px solid white;
  padding:40px 50px;
  box-sizing:content-box;
`;
export const Title = styled.h2`
  margin:0;
  font-size:48px;
  text-transform:uppercase;
  max-width:300px;

`;
